import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="sticky top-0 z-50 bg-white border-b-4 border-gymYellow shadow-sm">
      <div className="max-w-7xl mx-auto px-6 h-20 flex justify-between items-center">
        <Link to="/" className="flex items-center gap-2">
          <div className="w-12 h-12 bg-black rounded-full flex items-center justify-center text-white font-bold border-2 border-gymRed">G</div>
          <span className="text-xl font-black uppercase tracking-tighter">Gymnastics <span className="text-gymRed">Fit Planet</span></span>
        </Link>
        
        <div className="hidden md:flex gap-8 font-bold uppercase text-sm">
          <Link to="/" className="hover:text-gymRed transition">Home</Link>
          <Link to="/register" className="hover:text-gymRed transition">Join Now</Link>
          <Link to="/admin" className="hover:text-gymRed transition text-gray-400">Admin</Link>
        </div>

        <Link to="/register" className="bg-gymRed text-white px-6 py-2 rounded font-bold hover:bg-black transition">
          GET STARTED
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
